import React, { useState, useEffect } from "react";
import axios from "axios";

function EmployeeEarnings() {
  const [overallSummary, setOverallSummary] = useState({
    totalEarnings: 0,
    commission: 0,
    jobSummary: {
      totalAssigned: 0,
      completed: 0,
      inProgress: 0,
      pending: 0,
      cancelled: 0,
    },
  });
  const [monthlyReports, setMonthlyReports] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  // Fetch earnings data from API
  useEffect(() => {
    const fetchEarnings = async () => {
      try {
        setLoading(true);
        const token = localStorage.getItem('token');

        if (!token) {
          setError("Authentication required. Please log in.");
          setLoading(false);
          return;
        }

        const response = await axios.get('http://localhost:5000/api/employee/earnings', {
          headers: {
            Authorization: `Bearer ${token}`
          }
        });

        setOverallSummary(response.data.overallSummary);
        setMonthlyReports(response.data.monthlyReports);
        setLoading(false);
        setError(null);
      } catch (err) {
        console.error("Error fetching earnings:", err);
        setError("Failed to load earnings. Please try again later.");
        setLoading(false);
      }
    };

    fetchEarnings();
  }, []);

  const getMonthName = (monthNumber) => {
    const date = new Date();
    date.setMonth(monthNumber - 1); // Month is 0-indexed
    return date.toLocaleString('en-US', { month: 'long' });
  };

  if (loading) {
    return <p className="text-center">Loading earnings...</p>;
  }

  if (error) {
    return <div className="status-message error">Error: {error}</div>;
  }

  return (
    <div className="card" style={{ maxWidth: 800, margin: "2rem auto" }}>
      <h3 style={{ marginBottom: "1.5rem", textAlign: "center", color: 'var(--color-text)' }}>Earnings & Job Summary</h3>

      {/* Overall Summary */}
      <h4 style={{ marginBottom: "1rem", color: 'var(--color-primary)' }}>Overall Summary</h4>
      <div className="grid-container mb-4">
        <div className="card text-center bg-light">
          <h4>Total Earnings</h4>
          <p className="text-2xl font-bold text-secondary">
            ₹{overallSummary.totalEarnings.toFixed(2)}
          </p>
        </div>
        <div className="card text-center bg-light">
          <h4>Commission (10%)</h4>
          <p className="text-2xl font-bold text-primary">
            ₹{overallSummary.commission.toFixed(2)}
          </p>
        </div>
      </div>

      {/* Overall Job Summary */}
      <h4 style={{ marginBottom: "1rem", color: 'var(--color-text)' }}>Overall Job Overview</h4>
      <div className="grid-container mb-4">
        <div className="card text-center bg-light">
          <h5>Total Assigned</h5>
          <p className="text-xl font-bold text-dark">{overallSummary.jobSummary.totalAssigned}</p>
        </div>
        <div className="card text-center bg-light">
          <h5>Completed</h5>
          <p className="text-xl font-bold text-success">{overallSummary.jobSummary.completed}</p>
        </div>
        <div className="card text-center bg-light">
          <h5>In Progress</h5>
          <p className="text-xl font-bold text-secondary">{overallSummary.jobSummary.inProgress}</p>
        </div>
        <div className="card text-center bg-light">
          <h5>Pending</h5>
          <p className="text-xl font-bold text-warning">{overallSummary.jobSummary.pending}</p>
        </div>
        <div className="card text-center bg-light">
          <h5>Cancelled</h5>
          <p className="text-xl font-bold text-error">{overallSummary.jobSummary.cancelled}</p>
        </div>
      </div>

      {/* Monthly Reports */}
      <h4 style={{ marginBottom: "1rem", color: 'var(--color-primary)', marginTop: '2rem' }}>Monthly Work Reports</h4>
      {monthlyReports.length === 0 ? (
        <p className="text-center">No monthly work reports found.</p>
      ) : (
        monthlyReports.map((report) => (
          <div key={`${report.year}-${report.month}`} className="card bg-light mb-4" style={{ padding: '15px', borderRadius: '8px' }}>
            <h5 style={{ color: 'var(--color-secondary)', marginBottom: '10px' }}>
              {getMonthName(report.month)} {report.year}
            </h5>
            <div className="grid-container" style={{ gridTemplateColumns: 'repeat(auto-fit, minmax(120px, 1fr))', gap: '10px' }}>
              <div className="text-center">
                <small>Assigned</small>
                <p className="font-bold text-dark">{report.totalAssigned}</p>
              </div>
              <div className="text-center">
                <small>Completed</small>
                <p className="font-bold text-success">{report.completed}</p>
              </div>
              <div className="text-center">
                <small>In Progress</small>
                <p className="font-bold text-secondary">{report.inProgress}</p>
              </div>
              <div className="text-center">
                <small>Pending</small>
                <p className="font-bold text-warning">{report.pending}</p>
              </div>
              <div className="text-center">
                <small>Cancelled</small>
                <p className="font-bold text-error">{report.cancelled}</p>
              </div>
              <div className="text-center">
                <small>Earnings</small>
                <p className="font-bold text-primary">₹{report.monthlyEarnings.toFixed(2)}</p>
              </div>
              <div className="text-center">
                <small>Commission</small>
                <p className="font-bold text-accent">₹{report.commission.toFixed(2)}</p>
              </div>
            </div>
            {report.earningsDetails.length > 0 && (
              <div style={{ marginTop: '15px', borderTop: '1px solid var(--border)', paddingTop: '10px' }}>
                <h6 style={{ marginBottom: '5px', color: 'var(--color-textLight)' }}>Completed Jobs:</h6>
                <ul style={{ listStyle: 'none', padding: 0, margin: 0 }}>
                  {report.earningsDetails.map(job => (
                    <li key={job.id} style={{ fontSize: '0.9rem', color: 'var(--color-text)' }}>
                      {new Date(job.date).toLocaleDateString()}: {job.job} - ₹{job.amount.toFixed(2)}
                    </li>
                  ))}
                </ul>
              </div>
            )}
          </div>
        ))
      )}
    </div>
  );
}

export default EmployeeEarnings;
